const pageLinks = [
  { id: 1, href: "#home", text: "Home", iconLink: "fa-solid fa-house" },
  { id: 2, href: "#about", text: "About", iconLink: "fa-solid fa-user" },
  {
    id: 3,
    href: "#services",
    text: "Services",
    iconLink: "fa-brands fa-servicestack",
  },
  {
    id: 14,
    href: "#tours",
    text: "Tours",
    iconLink: "fa-solid fa-location-dot",
  },
];

const iconLinks = [
  {
    id: 1,
    href: "https://www.facebook.com",
    iconLink: "fa-brands fa-facebook fa-2x",
  },

  {
    id: 2,
    href: "https://www.twitter.com",
    iconLink: "fa-brands fa-twitter fa-2x",
  },

  {
    id: 3,
    href: "https://www.whatsapp.com",
    iconLink: "fa-brands fa-twitter fa-2x",
  },
];

export { pageLinks };

<ul className="nav-icons-list">
  <li>
    <a href="https://www.facebook.com">
      <i className="fa-brands fa-facebook fa-2x"></i>
    </a>
  </li>
  <li>
    <a href="https://www.twitter.com">
      <i className="fa-brands fa-twitter fa-2x"></i>
    </a>
  </li>
  <li>
    <a href="https://www.whatsapp.com">
      <i className="fa-brands fa-whatsapp fa-2x"></i>
    </a>
  </li>
</ul>;
